uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel1; // METAL TEXTURE(Slot 1)

// User Parameters
uniform float u_speed;
uniform float u_camera_dist;
uniform float u_fov;
uniform float u_twist;
uniform float u_thickness;
uniform float u_glow_intensity;
uniform float u_wave_height;
uniform float u_wave_freq;
uniform float u_blob_size;
uniform float u_reflectivity;
uniform float u_arm_count; 
uniform float u_leg_reach;   
uniform float u_pulse_speed; 
uniform float u_leg_complexity;

out vec4 fragColor;

// --- Utilities ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Spherical rotation utility for multidirectional arms
vec3 rot3D(vec3 p, vec3 axis, float angle) {
    return mix(dot(axis, p) * axis, p, cos(angle)) + cross(axis, p) * sin(angle);
}

float smin(float a, float b, float k) {
    float h = clamp(0.5 + 0.5 * (b - a) / k, 0.0, 1.0);
    return mix(b, a, h) - k * h * (1.0 - h);
}

// --- Blob Deformation Logic ---
float getBlobDeform(vec3 p) {
    float t = iTime * u_speed;
    float wave = sin(p.x * u_wave_freq + t) * cos(p.y * u_wave_freq * 0.8 + t * 0.5);
    wave += 0.5 * sin(p.z * u_wave_freq * 1.5 - t * 1.2);
    wave *= u_wave_height;
    // Organic breathing pulse
    wave += sin(iTime * u_pulse_speed) * 0.15;
    return wave;
}

// Distance Function
float map(vec3 p) {
    float t = iTime * u_speed * 0.5;

    // Core Body
    float bodyHover = sin(iTime * u_pulse_speed * 0.3) * 0.1;
    vec3 blobP = p - vec3(0.0, bodyHover, 0.0);

    float waveHeight = getBlobDeform(blobP);
    float blob = length(blobP) - u_blob_size + waveHeight;

    // Omni-directional Intelligent Legs
    float strands = 1e10;

    // Golden ratio spherical distribution for uniform "all directions" spread
    float phi = 3.14159265 * (3.0 - sqrt(5.0)); 

    for(float i = 0.0; i < 40.0; i += 1.0) {
        if (i >= u_arm_count) break;

        // Distribute arms across a sphere
        float y = 1.0 - (i / (u_arm_count - 1.0)) * 2.0; 
        float radius = sqrt(1.0 - y * y);
        float theta = phi * i;

        vec3 dir = vec3(cos(theta) * radius, y, sin(theta) * radius);

        // Project p onto the leg axis
        float h = clamp(dot(blobP, dir), 0.0, u_leg_reach);

        // Biological swaying and intelligent bending
        float legPhase = iTime * u_pulse_speed + i * 0.7;

        // Curvature math: move the evaluation point 'p' away from the axis based on height
        vec3 curveOffset = cross(dir, vec3(0,1,0)) * sin(h * u_leg_complexity + legPhase) * 0.4;
        curveOffset += cross(dir, vec3(1,0,0)) * cos(h * u_leg_complexity * 0.5 + legPhase * 0.8) * 0.3;

        // Tapering and pulsing thickness
        float tapering = 1.0 - (h / u_leg_reach);
        float thickness = u_thickness * tapering * (1.0 + 0.2 * sin(h * 5.0 - legPhase * 2.0));

        // Distance to the curved capsule segment
        float ribbon = length(blobP - (dir * h + curveOffset)) - thickness;

        strands = smin(strands, ribbon, 0.4);
    }

    return smin(blob, strands, 0.6);
}

// Normal calculation
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.01, 0.0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    float globalTime = iTime * u_speed;

    // --- Camera Orbit ---
    float camTime = iTime * 0.2;
    vec3 ro = vec3(sin(camTime)*u_camera_dist, cos(camTime*0.7)*u_camera_dist*0.4, cos(camTime)*u_camera_dist);
    vec3 ta = vec3(0.0, 0.0, 0.0);

    vec3 cw = normalize(ta - ro);
    vec3 cu = normalize(cross(cw, vec3(0, 1, 0)));
    vec3 cv = normalize(cross(cu, cw));
    vec3 rd = normalize(uv.x * cu + uv.y * cv + u_fov * cw);

    // --- Raymarching ---
    float t = 0.0;
    float d = 0.0;
    float glow = 0.0;

    for(int i = 0; i < 100; i++) { 
        vec3 p = ro + rd * t;
        d = map(p);

        // Proximity Glow
        float g = 0.012 / (0.08 + d * d);
        glow += g;

        if(d < 0.001 || t > 40.0) break;
        t += d; 
    }

    vec3 col = vec3(0.01, 0.012, 0.02); // Deep dark void

    // --- Shading ---
    if(t < 40.0) {
        vec3 p = ro + rd * t;
        vec3 n = getNormal(p);
        vec3 ref = reflect(rd, n);

        // Bio-luminescent skin color logic
        vec3 bioColor = 0.5 + 0.5 * cos(vec3(0.1, 0.4, 0.8) + length(p) * 0.3 + iTime * 0.5);
        vec3 skinTex = texture(iChannel1, p.xy * 0.2 + p.z * 0.3).rgb;

        vec3 interior = skinTex * bioColor * 1.2;
        vec3 lp = vec3(5.0, 10.0, 5.0);
        vec3 ld = normalize(lp - p);
        float diff = max(dot(n, ld), 0.0);
        float fres = pow(1.0 + dot(rd, n), 3.0);
        float spec = pow(max(dot(ref, ld), 0.0), 32.0); 

        col = interior * (diff + 0.1);
        col += bioColor * fres * 0.6; 
        col += vec3(1.0) * spec * 0.4; 
    }

    // Dynamic Glow effect
    vec3 glowCol = 0.5 + 0.5 * cos(vec3(0.0, 0.5, 1.0) + globalTime * 0.5);
    col += glow * glowCol * u_glow_intensity;

    // Fog and Post processing
    col = mix(col, vec3(0.005, 0.01, 0.015), smoothstep(15.0, 40.0, t));
    col = smoothstep(-0.05, 1.1, col);
    col = pow(col, vec3(1.1)); 

    fragColor = vec4(col, 1.0);
}
